if (!HandlerHelper.isPathUnsafe(requestFilename) && !requestFilename.contains("..")) {


    if(getLogger().isDebugEnabled()){
        getLogger().debug("Request filename {}", requestFilename);
    }

    if(requestFilename.endsWith("/")){
        requestFilename += "index.html";
    }

if (HandlerHelper.isPathSafe(requestFilename)) {


    if (requestFilename.startsWith("/")) {
        requestFilename = requestFilename.substring(1);
    }

    if (requestFilename.startsWith(APP_THEME_PATTERN.toString())) {
        requestFilename = requestFilename.substring(APP_THEME_PATTERN.toString().length());
    }

